window.JST['genome-pcr'] = template("<header>\n  <div class=\"container\">\n    <ol class=\"breadcrumb\">\n        <li> Edge </li>\n        <li> <a href=\"#/genomes\">Genomes</a> </li>\n        <li> <a href=\"#/genomes/{{ genome.id }}\"><span class=\"fs-block\" ng-bind-html='genome.name'></span></a> </li>\n        <li> PCR </li>\n    </ol>\n  </div>\n</header>\n\n<div class=\"container\">\n\n<h3>PCR on Genome {{ genome.id }}: <span class=\"fs-block\" ng-bind-html='genome.name'></span></h3>\n\n<form role=\"form\" class=\"space-top\">\n    <div class=\"form-inline\">\n        Primers\n        <div class=\"form-group\">\n            <input required class=\"form-control\" type=\"text\" ng-model=\"primer_a\" size=\"40\" />\n        </div>\n        and\n        <div class=\"form-group\">\n            <input required class=\"form-control\" type=\"text\" ng-model=\"primer_b\" size=\"40\" />\n        </div>\n        <button class=\"btn btn-primary\" ng-click=\"Pcr(primer_a, primer_b)\">PCR</button>\n    </div>\n</form>\n\n<div ng-if=\"results\" class=\"space-top\">\n    <div ng-if=\"results[0]\">\n        <p>\n            <span class=\"label label-success\">PCR Product: {{ results[0].length }} bps</span>\n        </p>\n        <div class=\"sequence sequence-break\">{{ results[0] }}</div>\n        <p>\n            Genomic region amplified:\n            <a class=\"fs-block\" href=\"#/genomes/{{ genome.id }}/fragments/{{ results[3].fragment_id }}?bp={{ results[3].region[0] }},{{ results[3].region[1] }}\"\n             >{{ results[3].fragment_name }} {{ results[3].region[0] }}-{{ results[3].region[1] }}</a>\n        </p>\n    </div>\n    \n    <div ng-if=\"!results[0]\">\n        <p>\n            <span class=\"label label-danger\">Cannot compute PCR product. Too many or too few binding sites.</span>\n        </p>\n    </div>\n\n    <partial template=\"blast-results\" ng-init=\"blast_results=results[1].concat(results[2])\"></partial>\n\n</div>\n\n</div>\n");
window.JST['genome-recombination'] = template("<header>\n  <div class=\"container\">\n    <ol class=\"breadcrumb\">\n        <li> Edge </li>\n        <li> <a href=\"#/genomes\">Genomes</a> </li>\n        <li> <a href=\"#/genomes/{{ genome.id }}\"><span class=\"fs-block\" ng-bind-html='genome.name'></span></a> </li>\n        <li> Recombination </li>\n    </ol>\n  </div>\n</header>\n\n<div class=\"container\">\n\n<h3>Recombination on Genome {{ genome.id }}: <span class=\"fs-block\" ng-bind-html='genome.name'></span></h3>\n\n<form role=\"form\" class=\"space-top\" id=\"recombine-inputs\">\n    <div class=\"form-inline\">\n        Homology arm length\n        <div class=\"form-group\">\n            <input required class=\"form-control\" type=\"text\" ng-model=\"homology_arm_length\" size=\"5\" />\n        </div>\n        New genome name\n        <div class=\"form-group\">\n            <input required class=\"form-control fs-block\" type=\"text\" ng-model=\"new_genome_name\" size=\"20\" />\n        </div>\n    </div>\n    Cassette (including homology arms)\n    <br/>\n    <textarea class=\"form-control sequence fs-block\" ng-model=\"cassette\"></textarea>\n    <button class=\"btn btn-primary\" ng-click=\"FindRegions()\">Preview</button>\n</form>\n\n<div id=\"recombine-primer3-opts\" class=\"space-top\">\n  <p>\n    Primer3 params (for verification primers)\n  </p>\n\n  <table class=\"table table-condensed\">\n    <tr>\n      <td>OPT_SIZE:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_OPT_SIZE\" /></td>\n      <td>MIN_SIZE:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_MIN_SIZE\" /></td>\n      <td>MAX_SIZE:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_MAX_SIZE\" /></td>\n    </tr>\n    <tr>\n      <td>OPT_TM:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_OPT_TM\" /></td>\n      <td>MIN_TM:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_MIN_TM\" /></td>\n      <td>MAX_TM:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_MAX_TM\" /></td>\n    </tr>\n    <tr>\n      <td>MIN_GC:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_MIN_GC\" /></td>\n      <td>MAX_GC:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_MAX_GC\" /></td>\n    </tr>\n    <tr>\n      <td>SALT_MONOVALENT:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_SALT_MONOVALENT\" /></td>\n      <td>DNA_CONC nM:</td>\n      <td><input ng-model=\"primer3_opts.PRIMER_DNA_CONC\" /></td>\n    </tr>\n  </table>\n</div>\n\n<div class=\"clearfix\"></div>\n\n<div ng-if=\"waiting === true\">\n  <p>\n    <br/>\n    <em>Waiting for server to respond ...</em>\n    <br/>\n  </p>\n</div>\n\n<div ng-if=\"regions !== undefined\" class=\"results\">\n    <p ng-if=\"regions.length === 0\"><em>No matching region</em></p>\n    <div ng-if=\"regions.length > 0\">\n        <div ng-repeat=\"region in regions\" class=\"recombine-candidate\">\n            <h5>\n                Found integration region on fragment\n                <a class=\"fs-block\" href=\"#/genomes/{{ genome.id }}/fragments/{{ region.fragment_id }}?bp={{ region.start }},{{ region.end }}\"\n                 >{{ region.fragment_name }}: {{ region.start }}-{{ region.end }}</a>\n                Post integration region length: {{ region.cassette.length }} bps\n                <span ng-if=\"region.cassette_reversed\">\n                  (cassette will be integrated in reverse direction)\n                </span>\n            </h5>\n\n            <div ng-if=\"region.verification_front.length > 0\" class=\"primers\">\n                <p>\n                    PCR primers to verify 5' junction\n                    <br/>\n                    (product on modified genome only, no product on WT)\n                </p>\n                <ul>\n                    <li ng-repeat='primer in region.verification_front'><partial template='primer' /></li>\n                </ul>\n            </div>\n            <div ng-if=\"region.verification_back.length > 0\" class=\"primers\">\n                <p>\n                    PCR primers to verify 3' junction\n                    <br/>\n                    (product on modified genome only, no product on WT)\n                </p>\n                <ul>\n                    <li ng-repeat='primer in region.verification_back'><partial template='primer' /></li>\n                </ul>\n            </div>\n            <div ng-if=\"region.verification_cassette.length > 0\" class=\"primers\">\n                <p>\n                    PCR primers to verify whole cassette\n                    <br/>\n                    (product on modified genome and WT)\n                </p>\n                <ul>\n                    <li ng-repeat='primer in region.verification_cassette'><partial template='primer' /></li>\n                </ul>\n            </div>\n            <div ng-if=\"region.cassette_annotations.length > 0\">\n                <p>\n                    Inherited and new annotations on cassette\n                </p>\n                <ul>\n                    <li class=\"fs-block\" ng-repeat='a in region.cassette_annotations'>\n                      {{ a.base_first }}-{{a.base_last }} bps on cassette,\n                      {{ a.feature_name }} ({{ a.feature_type }})\n                      <span ng-if=\"a.feature_strand === -1\">reversed</span>\n                    </li>\n                </ul>\n            </div>\n        </div>\n    </div>\n    <p ng-if=\"regions.length === 1\">\n      <button class=\"btn btn-primary\" ng-click=\"Recombine()\">Create post-recombination genome</button>\n    </p>\n</div>\n\n</div>\n");
window.JST['header'] = template("<header>\n  <div class=\"container\">\n    <ol class=\"breadcrumb\">\n        <li> <a href=\"#/\">Edge</a> </li>\n        <li> <a href=\"#/genomes\">Genomes</a> </li>\n        <li> <a href=\"#/fragments\">Fragments</a> </li>\n        <li> <a href=\"#/import\">Import</a> </li>\n    </ol>\n  </div>\n</header>\n");
window.JST['import'] = template("<partial template=\"header\"></partial>\n\n<div class=\"container\">\n\n<p class=\"lead\">Genomes Import</p>\n\n<div class=\"well\" ng-show=\"addGenomeStatus.error\">\n    <span class=\"text-danger\">\n        Error: {{ addGenomeStatus.error }}\n    </span>\n</div>\n\n<div class=\"well\" ng-show=\"addGenomeStatus.pending\">\n    <span class=\"text-info\">\n        Pending: Importing Genome: {{ $scope.genome.name }}. It may take a few minutes for large gff file. Please wait.\n    </span> \n</div>\n\n<div class=\"well\" ng-show=\"addGenomeStatus.results\">\n    <span class=\"fs-block\" class=\"text-success\" ng-repeat='genome in addGenomeStatus.results.imported_genomes'>\n        Success: Added in Edge as <a ng-href=\"#/genomes/{{ genome.id }}\">Genome {{ genome.id }}: {{ genome.name }}</a>\n    </span>\n</div>\n\n<form name=\"userForm\" novalidate>\n\n    <div class=\"form-group\">\n        <label for=\"genomeName\">Genome Name:</label>\n        <input class=\"fs-block\" id=\"genomeName\" name=\"name\" type=\"text\" ng-model=\"genome.name\" required />\n    </div>\n    <div class=\"form-group\">\n        <label for=\"gffFile\">GFF File (GFF3 format):</label><br/>\n        <input id=\"gffFile\" type=\"file\" file-model=\"gffFile\"/>\n    </div>\n    <button class=\"btn btn-primary\" type=\"submit\" ng-disabled=\"userForm.$invalid\" ng-click=\"addGenome()\">Import</button>\n</form>\n\n</div> <!-- container -->\n");
window.JST['primer'] = template("Left: {{ primer.PRIMER_LEFT_SEQUENCE }} ({{ primer.PRIMER_LEFT_GC_PERCENT }} GC, {{ primer.PRIMER_LEFT_TM }} Tm<span ng-if=\"primer.PRIMER_LEFT_SEQUENCE_DISTANCE_TO_JUNCTION\">, {{ primer.PRIMER_LEFT_SEQUENCE_DISTANCE_TO_JUNCTION }} bps to junction</span>)\n<br/>\nRight: {{ primer.PRIMER_RIGHT_SEQUENCE }} ({{ primer.PRIMER_RIGHT_GC_PERCENT }} GC, {{ primer.PRIMER_RIGHT_TM }} Tm<span ng-if=\"primer.PRIMER_RIGHT_SEQUENCE_DISTANCE_TO_JUNCTION\">, {{ primer.PRIMER_RIGHT_SEQUENCE_DISTANCE_TO_JUNCTION }} bps to junction</span>)\n");
